import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import IconButton from '@mui/material/IconButton';
import Typography from '@mui/material/Typography';
import Menu from '@mui/material/Menu';
import MenuIcon from '@mui/icons-material/Menu';
import Container from '@mui/material/Container';
import Avatar from '@mui/material/Avatar';
import Button from '@mui/material/Button';
import Tooltip from '@mui/material/Tooltip';
import MenuItem from '@mui/material/MenuItem';
// import { Link } from "react-router-dom";

const Header = () => {
    const [anchorElNav, setAnchorElNav] = React.useState(null);
    const [anchorElUser, setAnchorElUser] = React.useState(null);

    const handleOpenNavMenu = (event) => {
        setAnchorElNav(event.currentTarget);
    };
    const handleOpenUserMenu = (event) => {
        setAnchorElUser(event.currentTarget);
    };

    const handleCloseNavMenu = () => {
        setAnchorElNav(null);
    };

    const handleCloseUserMenu = () => {
        setAnchorElUser(null);
    };

    return (
        <AppBar position="static" sx={{ backgroundColor: 'white', height: '5.5rem' }}>
            <Container maxWidth="xl">
                <Toolbar disableGutters sx={{ paddingTop: '0.5rem' }}>
                    <Link to="/"
                        variant="h6"
                        noWrap
                        component="div"
                        sx={{ mr: 2, display: { xs: 'none', md: 'flex' }, cursor: 'pointer', color: 'blue' }}
                    >
                        LOGO
                    </Link>

                    <Box sx={{ flexGrow: 1, display: { xs: 'flex', md: 'none' } }}>
                        <IconButton
                            size="large"
                            aria-label="account of current user"
                            aria-controls="menu-appbar"
                            aria-haspopup="true"
                            onClick={handleOpenNavMenu}
                            color="inherit"
                        >
                            <MenuIcon sx={{ fill: 'blue' }} />
                        </IconButton>
                        <Menu
                            id="menu-appbar"
                            anchorEl={anchorElNav}
                            anchorOrigin={{
                                vertical: 'bottom',
                                horizontal: 'left',
                            }}
                            keepMounted
                            transformOrigin={{
                                vertical: 'top',
                                horizontal: 'left',
                            }}
                            open={Boolean(anchorElNav)}
                            onClose={handleCloseNavMenu}
                            sx={{
                                display: { xs: 'block', md: 'none' },
                            }}
                        >
                            <MenuItem onClick={handleCloseNavMenu}>
                                <Link to="/" textAlign="center" sx={{ color: 'blue', fontWeight: '600' }}>Dashboard</Link>
                            </MenuItem>
                            <MenuItem onClick={handleCloseNavMenu}>
                                <Link to="/notification" textAlign="center" sx={{ color: 'blue', fontWeight: '600' }}>Notifications</Link>
                            </MenuItem>
                            <MenuItem onClick={handleCloseNavMenu}>
                                <Link to="/document" textAlign="center" sx={{ color: 'blue', fontWeight: '600' }}>Documents</Link>
                            </MenuItem>
                            <MenuItem onClick={handleCloseNavMenu}>
                                <Link to="/project" textAlign="center" sx={{ color: 'blue', fontWeight: '600' }}>Projects</Link>
                            </MenuItem>
                            <MenuItem onClick={handleCloseNavMenu}>
                                <Link to="/isueetracking" textAlign="center" sx={{ color: 'blue', fontWeight: '600' }}>Isuee Tracking</Link>
                            </MenuItem>
                            <MenuItem onClick={handleCloseNavMenu}>
                                <Link to="/planexecute" textAlign="center" sx={{ color: 'blue', fontWeight: '600' }}>Plan & Execute</Link>
                            </MenuItem>
                            <MenuItem onClick={handleCloseNavMenu}>
                                <Link to="/timesheet" textAlign="center" sx={{ color: 'blue', fontWeight: '600' }}>Timesheet</Link>
                            </MenuItem>
                        </Menu>
                    </Box>
                    <Link
                        variant="h6"
                        noWrap
                        component="div"
                        sx={{ flexGrow: 1, display: { xs: 'flex', md: 'none' }, color: 'blue' }}
                    >
                        LOGO
                    </Link>
                    <Box sx={{ flexGrow: 1, display: { xs: 'none', md: 'flex' }, justifyContent: 'flex-end', paddingRight: '1rem' }}>
                        <Button sx={{ my: 2, color: 'white', display: 'block' }}>
                            <Link to="/" sx={{ color: 'blue', fontWeight: '600' }} >Dashboard</Link>
                        </Button>
                        <Button sx={{ my: 2, color: 'white', display: 'block' }}>
                            <Link to="/notification" sx={{ color: 'blue', fontWeight: '600' }} > Notifications</Link>
                        </Button>
                        <Button sx={{ my: 2, color: 'white', display: 'block' }}>
                            <Link to="/document" sx={{ color: 'blue', fontWeight: '600' }} > Documents</Link>
                        </Button>
                        <Button sx={{ my: 2, color: 'white', display: 'block' }}>
                            <Link to="/project" sx={{ color: 'blue', fontWeight: '600' }} > Projects</Link>
                        </Button>
                        <Button sx={{ my: 2, color: 'white', display: 'block' }}>
                            <Link to="/isueetracking" sx={{ color: 'blue', fontWeight: '600' }} > Isuee Tracking</Link>
                        </Button>
                        <Button sx={{ my: 2, color: 'white', display: 'block' }}>
                            <Link to="/planexecute" sx={{ color: 'blue', fontWeight: '600' }} > Plan & Execute</Link>
                        </Button>
                        <Button sx={{ my: 2, color: 'white', display: 'block' }}>
                            <Link to="/timesheet" sx={{ color: 'blue', fontWeight: '600' }} > Timesheet</Link>
                        </Button>
                    </Box>

                    <Box sx={{ flexGrow: 0 }}>
                        <Tooltip>
                            <IconButton onClick={handleOpenUserMenu} sx={{ p: 0 }}>
                                <Avatar alt="Remy Sharp" src="/static/images/avatar/2.jpg" />
                            </IconButton>
                        </Tooltip>
                        <Menu
                            sx={{ mt: '45px' }}
                            id="menu-appbar"
                            anchorEl={anchorElUser}
                            anchorOrigin={{
                                vertical: 'top',
                                horizontal: 'right',
                            }}
                            keepMounted
                            transformOrigin={{
                                vertical: 'top',
                                horizontal: 'right',
                            }}
                            open={Boolean(anchorElUser)}
                            onClose={handleCloseUserMenu}
                        >
                            <MenuItem onClick={handleCloseUserMenu}>
                                <Link to="/job" textAlign="center" sx={{ color: 'blue', fontWeight: '600' }}>JOBS</Link>
                            </MenuItem>
                            <MenuItem onClick={handleCloseUserMenu}>
                                <Link to="/user" textAlign="center" sx={{ color: 'blue', fontWeight: '600' }}>USERS</Link>
                            </MenuItem>
                            <MenuItem onClick={handleCloseUserMenu}>
                                <Link to="/employee" textAlign="center" sx={{ color: 'blue', fontWeight: '600' }}>EMPLOYEES</Link>
                            </MenuItem>
                            <MenuItem onClick={handleCloseUserMenu}>
                                <Link to="/changepassword" textAlign="center" sx={{ color: 'blue', fontWeight: '600' }}>CHANGE PASSWORD</Link>
                            </MenuItem><MenuItem onClick={handleCloseUserMenu}>
                                <Typography textAlign="center" sx={{ color: 'blue', fontWeight: '600' }}>LOG OUT</Typography>
                            </MenuItem>
                        </Menu>
                    </Box>
                </Toolbar>
            </Container>
        </AppBar >
    );
};
export default Header;
